import Vue from 'vue'
import VueRouter from 'vue-router'
import HomeView from '../views/HomeView.vue'
import TestLinkView from '../views/TestLinkView.vue'
Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'home',
    redirect:'/path'
  },
  {
    path: '/path',
    name: 'path',
    component: HomeView
  },
  {
    name: 'TestLinkView',
    component: TestLinkView
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
